/*
 * @Date: 2020-03-19 04:13:57
 * @LastEditors: lifangdi
 * @LastEditTime: 2020-03-20 16:12:09
 */
import React, { Suspense, Component } from 'react';
import { observer, inject } from 'mobx-react';
import logo from './logo.svg';
import { Button } from 'antd-mobile'
import { HashRouter, Route, withRouter, Switch, Redirect } from 'react-router-dom';

import Welcome from './pages/Welcome';
import Login from './pages/Login';

@observer
class SinglePages extends Component {
  state = {
    clientHeight: 736
  }
  render() {
    return (
      <HashRouter>
        <Switch>
          <Suspense fallback={null}>
            <Route path="/single/welcome" exact component={Welcome} />
            <Route path="/single/login" component={Login}></Route>
          </Suspense>
        </Switch>
      </HashRouter>
    );
  }
}

export default SinglePages;
